 
import { Image } from '../Image/index'
interface LogoProps {
  variant?: 'standard' | 'short' | 'text' | 'gray' | 'textnl' | 'small' | 'smallwhite' | 'smallwhitenl'
  altText?: string
}

export const QXLogoSmallWhiteNoLogo = 'data:image/svg+xml;base64,'

export const QXLogoSmallWhite = 'data:image/svg+xml;base64,'

export const QXLogoSmall = 'data:image/svg+xml;base64,'
export const QXLogoNoLogoText = 'data:image/svg+xml;base64,'
export const QXLogoText = 'data:image/svg+xml;base64,'
export const QXLogoShortGray = 'data:image/svg+xml;base64,'

export const QXLogoShort = 'data:image/svg+xml;base64,'


export const QXLogo = 'data:image/svg+xml;base64,'

export const LogoGrayData =
  'data:image/svg+xml;base64,'

export const Logo = ({
  variant = 'standard',
  altText = 'Quantum-X',
  ...props
}: LogoProps) => {
  let image

  switch (variant) {
    case 'short':
      image = QXLogoShort
      break
    case 'text':
      image = QXLogoText
      break
    case 'gray':
      image = QXLogoShortGray
      break
    case 'textnl':
      image = QXLogoNoLogoText
      break
    case 'small':
      image = QXLogoSmall
      break
    case 'smallwhite':
      image = QXLogoSmallWhite
      break
    case 'smallwhitenl':
      image = QXLogoSmallWhiteNoLogo
      break
    default:
      image = QXLogo
  }
  return <Image src={image} alt={altText} {...props} />
}
